import React from 'react';
import { Redirect } from 'react-router-dom';

const Logout = ()=>{

    return(
        <>
            {localStorage.removeItem('isLogin')?<Redirect to="/user" />:null}

            <h1>Logout</h1>
        </>
    )
};

export default Logout;
